pragma solidity ^0.8.0;

import "./VoyagerStorage.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "../reference/Sig.sol";

// 500个创世铸造权，其余铸造要消耗DGT和DSP
// 满足条件触发NFT升级
// 1. 属性设置：等级、图片、编号
// 
// 合约及其功能：
// 1. VoyagerAccessControl: 控制操作权限
// 2. VoyagerBase: 通用基础的数据结构、变量
// 3. SaleClockAuction: 用于Voyager的拍卖出售

// /// @title The facet of the Voyager core contract that manages Voyager levelup.
// /// @author Andrew Fang (https://www.github.com/Andrew-DeepGo)
// /// @dev Ref: todo
contract VoyagerLogic is BaseStorage, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    VoyagerStorage public vS;

    function testSetVs(address _vs) public {
        vS = VoyagerStorage(_vs);
    }

    function testDelegatecall() external view returns (uint){
        return vS.getTokenIDWithoutURI(msg.sender);
    }

    /**
    * Mint Voyagers，初始化: 1.最大level, 2.不同level数量，3.所有权，4.持有总量
    */
    function mintVoyagerByWhitelist() external
    {
        require(vS.getTokenIDWithoutURI(msg.sender) == 0, "Set tokenURI first");
        // require(verified(Sig.ethSignedHash(msg.sender), signature), "Not verified");
        require(!vS.getExpiredWhitelist(msg.sender), "Expired");
        // require(mintIsActive, "Unactive to mint Voyager");
        require(vS.getWhitelistExpired().add(1) <= vS.getMaxWhitelisted(), 
                            "Mint would exceed max supply of Voyagers");

        uint256 tokenID = vS.getTotalMinted();

        vS.mintVoyayer(msg.sender, tokenID);

        if (tokenID == 0) {
            vS._setTokenURI(tokenID, vS.getToken0URI());
        } else {
            vS.setTokenIDWithoutURI(msg.sender, tokenID);
        }

        vS.setTotalMinted(vS.getTotalMinted().add(1));
        vS.setExpiredWhitelist(msg.sender, true);
        vS.setWhitelistExpired(vS.getWhitelistExpired().add(1));
    }

    /**
    * Mint Voyagers，初始化: 1.最大level, 2.不同level数量，3.所有权，4.持有总量
    */
    function mintVoyager() public
    {
        require(vS.getTokenIDWithoutURI(msg.sender) == 0, "Set tokenURI first");
        // require(verified(Sig.ethSignedHash(msg.sender), signature), "Not verified");
        // require(!expiredWhitelist[msg.sender], "Expired");
        // require(mintIsActive, "Unactive to mint Voyager");
        // require(whitelistExpired.add(1) <= maxWhitelisted, "Mint would exceed max supply of Voyagers");
        (uint fee1, uint fee2) = vS.getLevelUpFee(vS.minLevel());
        // 余额足够
        require(IERC20(dgtAddress).balanceOf(msg.sender) >= fee1, 
                                            "Unsufficient dgt token");
        require(IERC20(dspAddress).balanceOf(msg.sender) >= fee2, 
                                    "Unsufficient dsp token");
        // todo: 转账DGT到金库合约
        IERC20(dgtAddress).safeTransferFrom(msg.sender, address(this), fee1);
        // todo: 销毁DSP
        IERC20(dspAddress).safeTransferFrom(msg.sender, address(this), fee2);

        uint256 tokenID = vS.getTotalMinted();

        vS.mintVoyayer(msg.sender, tokenID);

        if (tokenID == 0) {
            vS._setTokenURI(tokenID, vS.getToken0URI());
        } else {
            vS.setTokenIDWithoutURI(msg.sender, tokenID);
        }

        vS.setTotalMinted(vS.getTotalMinted().add(1));
        // expiredWhitelist[msg.sender] = true;
    }

    function changeTokenURI(uint256 tokenID, string memory _tokenURI) public {
        vS._setTokenURI(tokenID, _tokenURI);
    }

    // tokenID为0的tokenURI 
    function setToken0URI(string memory _tokenURI) public {
        vS.token0URI(_tokenURI);
    }

    // 获取address待生成URI的tokenID：tokenIDWithoutURI[address]

    // 获取tokenID的level: levelOfVoyager[tokenID]

    // 检查后端取回与存储id，
    function setTokenURI(uint256 _tokenid, uint256 _level, string memory _tokenURI) public {
        uint256 tokenID = vS.getTokenIDWithoutURI(msg.sender);
        uint256 level = vS.getVoyager(vS.getAllVoyagerIndex(tokenID)).level;

        require(tokenID > 0, "Unvalid token");
        require(vS.ownerOf(tokenID) == msg.sender, "Not owner");
        require(_tokenid == tokenID, "Consistent tokenID");
        require(level == _level, "Consistent level");
        require(!vS.getSetByOwner(tokenID, level), "Set over once");
        vS._setTokenURI(tokenID, _tokenURI);

        vS.setTokenIDWithoutURI(msg.sender, 0);
        vS.setSetByOwner(tokenID, level, true);
    }

    // 升级逻辑,更新: 1.最大level, 2.不同level数量，3.所有权，4.持有总量
    function levelUp(uint256 tokenID) public nonReentrant {
        require(tokenID != 0, "Not 0 token");
        require(vS.getTokenIDWithoutURI(msg.sender) == 0, "Unvalid token");
        require(vS.getVoyager(vS.getAllVoyagerIndex(tokenID)).level < vS.maxLevel(), 
                                                          "Already max level");
        uint fee1;
        uint fee2;
        uint level = vS.getLevel(tokenID);
        (fee1, fee2) = vS.getLevelUpFee(level);
        // 余额足够
        require(IERC20(dgtAddress).balanceOf(msg.sender) >= fee1, 
                                            "Unsufficient dgt token");
        require(IERC20(dspAddress).balanceOf(msg.sender) >= fee2, 
                                    "Unsufficient dsp token");
        // todo: 转账DGT到金库合约
        IERC20(dgtAddress).safeTransferFrom(msg.sender, address(this), fee1);
        // todo: 销毁DSP
        IERC20(dspAddress).safeTransferFrom(msg.sender, address(this), fee2);

        // 完成升级，更新不同level的数量， NFT的level
        vS.setTokenLevelCount(msg.sender, vS.getLevel(tokenID), 
                    vS.getTokenLevelCount(msg.sender, vS.getLevel(tokenID))-1);
        vS.setLevel(tokenID, vS.getLevel(tokenID) + 1);
        // levelOfVoyager[tokenID] = voyagers[tokenID].level;
        vS.setTokenLevelCount(msg.sender, vS.getLevel(tokenID), 
                    vS.getTokenLevelCount(msg.sender, vS.getLevel(tokenID))+1);
        vS.setTokenIDWithoutURI(msg.sender, tokenID);

        // 更新maxLevel
        if (vS.getVoyager(vS.getAllVoyagerIndex(tokenID)).level > vS.getMaxLevelOfOwner(msg.sender)) {
            vS.setMaxLevelOfOwner(msg.sender, vS.getVoyager(vS.getAllVoyagerIndex(tokenID)).level);
        }
    }

    function setFee1TokenAddress(address _token1) external {
        dgtAddress = _token1;
    }

    function setFee2TokenAddress(address _token2) external {
        dspAddress = _token2;
    }

    // /* Test functions */
    // function testMintVoyager(
    //     bytes memory signature
    // ) public view returns (bool)
    // {
    //     // require(vS.getTokenIDWithoutURI(msg.sender) == 0, "Set tokenURI first");
    //     return Sig.verified(Sig.ethSignedHash(msg.sender), signature, admin());
    // }
}
