import "./VoyagerAccessControl.sol";
import "./BaseStorage.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../reference/Sig.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";

contract VoyagerStorage is ERC721, IERC721Enumerable, BaseStorage, VoyagerAccessControl {
    using SafeMath for uint;
    // using SafeERC20 for IERC20;

    /// @dev An array containing the Voyager struct for all Voyagers in existence. The ID of
    /// each Voyager is actually an index into this array.
    Voyager[] public voyagers;

    // Mapping from owner to list of owned token IDs
    mapping(address => mapping(uint256 => Voyager)) public ownedVoyagers;

    // Mapping from token ID to index of the owner tokens list
    mapping(uint256 => uint256) public ownedVoyagersIndex;

    // Mapping from token id to position in the allTokens array
    mapping(uint256 => uint256) public allVoyagersIndex;

    /// @dev A mapping from Voyager to the max level of the Voyager. 
    mapping (address => uint256) public maxLevelOfOwner;

    /// @dev A mapping from owner to token amount of each level. 
    mapping (address => mapping(uint256 => uint256)) public tokenLevelCount;

    mapping(uint256 => string) private _tokenURIs;
    mapping(uint256 => mapping(uint256 => bool)) public setByOwner; // tokenURI is set by owner in certain level
    mapping(address => uint256) private _tokenIDWithoutURI;
    mapping (address => bool) private _expiredWhitelist; 

    uint private _maxWhitelisted = 1000;
    uint private _totalMinted;
    uint private _whitelistExpired;
    string private _token0URI;

    constructor(uint256 _maxLevel) ERC721("Voyager", "VOG")  {
        maxLevel = _maxLevel;
        initialLevelUpFees();
    }

    function getVoyager(uint _index) public view returns (Voyager memory){
        return voyagers[_index];
    }

    function getSetByOwner(uint _tokenId, uint _level) public view returns (bool) {
        return setByOwner[_tokenId][_level];
    }

    function setSetByOwner(uint _tokenId, uint _level, bool _isSet) public onlyProxy{
        setByOwner[_tokenId][_level] = _isSet;
    }


    function getTokenIDWithoutURI(address _addr) public view returns (uint) {
        return _tokenIDWithoutURI[_addr];
    }

    function setTokenIDWithoutURI(address _addr, uint _tokenId) public onlyProxy {
        _tokenIDWithoutURI[_addr] = _tokenId;
    }

    function getMaxWhitelisted() public view returns (uint) {
        return _maxWhitelisted;
    }

    function getTotalMinted() public view returns (uint) {
        return _totalMinted;
    }

    function setTotalMinted(uint _amount) public onlyProxy {
        _totalMinted = _amount;
    }

    function getWhitelistExpired() public view returns (uint){
        return _whitelistExpired;
    }

    function setWhitelistExpired(uint _amount) public onlyProxy {
        _whitelistExpired = _amount;
    }

    function getToken0URI() public view returns (string memory) {
        return _token0URI;
    }

    function token0URI(string memory _string) public onlyProxy {
        _token0URI = _string;
    }

    function getExpiredWhitelist(address _addr) public view returns (bool) {
        return _expiredWhitelist[_addr];
    }

    function setExpiredWhitelist(address _addr, bool _isExpired) public onlyProxy {
        _expiredWhitelist[_addr] = _isExpired;
    }

    function getAllVoyagerIndex(uint _tokenId) public view returns (uint) {
        return allVoyagersIndex[_tokenId];
    }

    function getMaxLevelOfOwner(address _addr) public view returns (uint) {
        return maxLevelOfOwner[_addr];
    }

    function setMaxLevelOfOwner(address _addr, uint _level) public onlyProxy {
        maxLevelOfOwner[_addr] = _level;
    }

    function getTokenLevelCount(address _addr, uint _level) public view returns (uint) {
        return tokenLevelCount[_addr][_level];
    }

    function setTokenLevelCount(address _addr, uint _level, uint _amount) public onlyProxy {
        tokenLevelCount[_addr][_level] = _amount;
    }

    function mintVoyayer(address _addr, uint _tokenId) public onlyProxy {
        _safeMint(_addr, _tokenId);
    }

    function transfer(address _to, uint _tokenId) public {
        _safeTransfer(msg.sender, _to, _tokenId, "");
    }

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId) public view virtual override(IERC165, ERC721) returns (bool) {
        return interfaceId == type(IERC721Enumerable).interfaceId || super.supportsInterface(interfaceId);
    }

    /**
     * @dev See {IERC721Enumerable-tokenOfOwnerByIndex}.
     */
    function tokenOfOwnerByIndex(address owner, uint256 index) public view virtual override returns (uint256) {
        require(index < ERC721.balanceOf(owner), "ERC721Enumerable: owner index out of bounds");
        return ownedVoyagers[owner][index].id;
    }

    /**
     * @dev See {IERC721Enumerable-totalSupply}.
     */
    function totalSupply() public view virtual override returns (uint256) {
        return voyagers.length;
    }

    /**
     * @dev See {IERC721Enumerable-tokenByIndex}.
     */
    function tokenByIndex(uint256 index) public view virtual override returns (uint256) {
        require(index < VoyagerStorage.totalSupply(), "ERC721Enumerable: global index out of bounds");
        return voyagers[index].id;
    }

    function initialLevelUpFees() internal {
        for (uint i=0; i < maxLevel; i++) {
            levelUpFees.push(FeeComponent(i.add(1).mul(10 * decimals),i.add(1).mul(100 * decimals)));
        }
    }

        // 在transfer之前更新:1.最大level, 2.不同level数量，3.所有权，4.持有总量
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override virtual {
        super._beforeTokenTransfer(from, to, tokenId);

        if (from == address(0)) {
            _addTokenToAllTokensEnumeration(tokenId);
        } else if (from != to) {
            _removeTokenFromOwnerEnumeration(from, tokenId);
            _updateSenderMaxLevel(from, tokenId);
        }
        if (to == address(0)) {
            _removeTokenFromAllTokensEnumeration(tokenId);
        } else if (to != from) {
            _addTokenToOwnerEnumeration(to, tokenId);
            _updateReceiverMaxLevel(to, tokenId);
            tokenLevelCount[to][voyagers[allVoyagersIndex[tokenId]].level] += 1;
        }
    }

    function _updateSenderMaxLevel(address from, uint256 tokenId) private {
        // update from address maxLevel
        uint curLevel = voyagers[allVoyagersIndex[tokenId]].level;
        require(curLevel <= maxLevelOfOwner[from], "Level over max");
        // ownershipTokenCount[from] -= 1;
        tokenLevelCount[from][curLevel] -= 1;

        if (ERC721.balanceOf(from) == 0) {
            maxLevelOfOwner[from] = 0;
        } else if ( curLevel == maxLevelOfOwner[from] ) {
            for (; curLevel > 0; curLevel--) {
                if (tokenLevelCount[from][curLevel] > 0) {
                    maxLevelOfOwner[from] = curLevel;
                    break;
                }
            }
        }
    }

    function _updateReceiverMaxLevel(address to, uint256 tokenId) private {
        // update to address maxLevel
        uint curLevel = voyagers[allVoyagersIndex[tokenId]].level;
        if (curLevel > maxLevelOfOwner[to]) {
            maxLevelOfOwner[to] = curLevel;
        }
    }

    /**
     * @dev Private function to add a token to this extension's ownership-tracking data structures.
     * @param to address representing the new owner of the given token ID
     * @param tokenId uint256 ID of the token to be added to the tokens list of the given address
     */
    function _addTokenToOwnerEnumeration(address to, uint256 tokenId) private {
        uint256 length = ERC721.balanceOf(to);
        ownedVoyagers[to][length] = voyagers[allVoyagersIndex[tokenId]];
        ownedVoyagersIndex[tokenId] = length;
    }

    /**
     * @dev Private function to add a token to this extension's token tracking data structures.
     * @param tokenId uint256 ID of the token to be added to the tokens list
     */
    function _addTokenToAllTokensEnumeration(uint256 tokenId) private {
        allVoyagersIndex[tokenId] = voyagers.length;
        if (tokenId == 0) {
            voyagers.push(Voyager(uint8(maxLevel), tokenId));
        } else {
            voyagers.push(Voyager(uint8(minLevel), tokenId));
        }
    }

    /**
     * @dev Private function to remove a token from this extension's ownership-tracking data structures. Note that
     * while the token is not assigned a new owner, the `_ownedTokensIndex` mapping is _not_ updated: this allows for
     * gas optimizations e.g. when performing a transfer operation (avoiding double writes).
     * This has O(1) time complexity, but alters the order of the _ownedTokens array.
     * @param from address representing the previous owner of the given token ID
     * @param tokenId uint256 ID of the token to be removed from the tokens list of the given address
     */
    function _removeTokenFromOwnerEnumeration(address from, uint256 tokenId) private {
        // To prevent a gap in from's tokens array, we store the last token in the index of the token to delete, and
        // then delete the last slot (swap and pop).

        uint256 lastTokenIndex = ERC721.balanceOf(from) - 1;
        uint256 tokenIndex = ownedVoyagersIndex[tokenId];

        // When the token to delete is the last token, the swap operation is unnecessary
        if (tokenIndex != lastTokenIndex) {
            Voyager  storage lastVoyager = ownedVoyagers[from][lastTokenIndex];

            ownedVoyagers[from][tokenIndex] = lastVoyager; // Move the last token to the slot of the to-delete token
            ownedVoyagersIndex[lastVoyager.id] = tokenIndex; // Update the moved token's index
        }

        // This also deletes the contents at the last position of the array
        delete ownedVoyagersIndex[tokenId];
        delete ownedVoyagers[from][lastTokenIndex];
    }

    /**
     * @dev Private function to remove a token from this extension's token tracking data structures.
     * This has O(1) time complexity, but alters the order of the _allTokens array.
     * @param tokenId uint256 ID of the token to be removed from the tokens list
     */
    function _removeTokenFromAllTokensEnumeration(uint256 tokenId) private {
        // To prevent a gap in the tokens array, we store the last token in the index of the token to delete, and
        // then delete the last slot (swap and pop).

        // token array的max index 
        uint256 lastTokenIndex = voyagers.length - 1;
        // 被删除token所在的array index
        uint256 tokenIndex = allVoyagersIndex[tokenId];

        // When the token to delete is the last token, the swap operation is unnecessary. However, since this occurs so
        // rarely (when the last minted token is burnt) that we still do the swap here to avoid the gas cost of adding
        // an 'if' statement (like in _removeTokenFromOwnerEnumeration)

        // token array中max index的token id
        Voyager storage lastVoyager = voyagers[lastTokenIndex];

        // 用最后一个Voyager替换被删除的那个
        voyagers[tokenIndex] = lastVoyager; // Move the last token to the slot of the to-delete token
        // 更新最后一个token的index
        allVoyagersIndex[lastVoyager.id] = tokenIndex; // Update the moved token's index

        // This also deletes the contents at the last position of the array
        delete allVoyagersIndex[tokenId];
        voyagers.pop();
    }

    /// @dev Updates the level up fee as well as mint fee. Can only
    ///  be called by the Admin address.
    /// todo: 可设置maxLevel
    /// todo: 加maxLevel限制条件
    /// todo：加接口获取铸造或升级的费用
    function setLevelUpFee(uint256 _toLevel, uint256 _dgt, uint256 _dsp) external onlyOwner {
        require(_toLevel <= maxLevel, "Over max level");
        require(levelUpFees.length >= _toLevel-1, "Add fee from low level");
        if (levelUpFees.length == _toLevel-1) {
            levelUpFees.push(FeeComponent(_dgt, _dsp));
        } else {
            levelUpFees[_toLevel-1] = FeeComponent(_dgt, _dsp);
        }
    }

    function setCoolDown(uint256 _toLevel, uint32 _interval) external onlyOwner {
        require (_toLevel > 1 && _toLevel <= cooldowns.length.add(1), "Over max level"); 
        cooldowns[_toLevel-2] = _interval;
    }


    /// @dev The address of the ClockAuction contract that handles sales of Kitties. 
    /// This same contract handles both peer-to-peer.
    // SaleClockAuction public saleAuction;
    // todo：获取升级的费用
    function getLevelUpFee(uint256 level) public view returns (uint, uint) {
        return (levelUpFees[level].dgt, levelUpFees[level].dsp);
    }

    function getLevel(uint tokenId) public view returns (uint){
        return voyagers[allVoyagersIndex[tokenId]].level;
    }

    function setLevel(uint tokenId, uint level) public onlyProxy {
        voyagers[allVoyagersIndex[tokenId]].level = uint8(level);
    }

    /*     
    * Set URI for NFT with tokenId 
    */
    function _setTokenURI(uint256 _tokenId, string memory _tokenURI) public virtual onlyProxy {
        require(_exists(_tokenId), "ERC721Metadata: URI set of nonexistent token");
        _tokenURIs[_tokenId] = _tokenURI;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        string memory _tokenURI = _tokenURIs[tokenId];

        return _tokenURI;
    }

    function setFee1TokenAddress(address _token1) public onlyProxy {
        dgtAddress = _token1;
    }

    function setFee2TokenAddress(address _token2) public onlyProxy {
        dspAddress = _token2;
    }
}
